    @Test
    public void testTranslate() throws Exception {
        DownloadVCF dVCF = new DownloadVCF();
        List<String> wildtypeList = Arrays.asList("H","L");
        List<String> homozygousList = Arrays.asList("A","B","C");
        List<String> heterozygousList = Arrays.asList("W","X","Y");

        assertEquals("0/0", dVCF.translateType(wildtypeList,homozygousList,heterozygousList,"H") );
        assertEquals("1/1", dVCF.translateType(wildtypeList,homozygousList,heterozygousList,"A") );
        assertEquals("0/1", dVCF.translateType(wildtypeList,homozygousList,heterozygousList,"W") );
        assertEquals("./.", dVCF.translateType(wildtypeList,homozygousList,heterozygousList,"F") );
    }



